{c_important}명사수{/c} 기술을 시전하면 {c_important}정밀도{/c} 중첩을 1개 얻습니다. 해당 기술이 극대화로 적중하면 시전당 한 번 추가 중첩을 얻습니다.

{c_important}정밀도{/c}가 {c_number}[SF_1]{/c} 중첩에 도달하면 모든 {c_important}정밀도{/c} 중첩을 소모하여 다음 {c_important}명사수{/c} 궁극기 또는 핵심 기술이 확정적으로 극대화로 적중하고, {c_number}[SF_10 * 100|%x|]{/c} 증가한 극대화 피해를 줍니다. 이 피해는 극대화 피해 증가 효과의 {c_number}[{SF_6} * 100|x%|]{/c}만큼 추가로 증가합니다.

현재 증가량: {c_number}[{SF_7} * 100|1%x|]{/c}
